import React, { useEffect, useState } from "react";
import axios from "axios";
import TopBar from "../components/TopBar";
import dayjs from "dayjs";
import { FaSearch } from "react-icons/fa";

function TablingLogs() {
  const [logs, setLogs] = useState([]);
  const [filteredLogs, setFilteredLogs] = useState([]);
  const [organizations, setOrganizations] = useState([]);
  const [date, setDate] = useState(dayjs().format("YYYY-MM-DD"));
  const [orgFilter, setOrgFilter] = useState("All");
  const [actionFilter, setActionFilter] = useState("All");
  const [noShowFilter, setNoShowFilter] = useState("All");
  const [search, setSearch] = useState("");

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const res = await axios.get("/api/organizations/all-logs");
        setLogs(res.data);
      } catch (err) {
        console.error("Failed to fetch logs:", err);
      }
    };

    const fetchOrgs = async () => {
      try {
        const res = await axios.get("/api/organizations");
        setOrganizations(res.data);
      } catch (err) {
        console.error("Failed to fetch orgs:", err);
      }
    };

    fetchLogs();
    fetchOrgs();
  }, []);

  useEffect(() => {
    const filtered = logs.filter((log) => {
      const logDate = log.checkInTime || log.checkOutTime || log.rangeStart;
      if (!logDate) return false;

      const matchesDate = dayjs(logDate).format("YYYY-MM-DD") === date;
      const matchesOrg = orgFilter === "All" || log.organization === orgFilter;
      const matchesAction = actionFilter === "All" || log.action === actionFilter;
      const matchesNoShow =
        noShowFilter === "All" ||
        (noShowFilter === "Yes" && log.noShow) ||
        (noShowFilter === "No" && !log.noShow);
      const text = `${log.clientName} ${log.eventNumber} ${log.user} ${log.tablingSpot} ${log.notes}`.toLowerCase();

      const matchesSearch = text.includes(search.toLowerCase());
      return matchesDate && matchesOrg && matchesAction && matchesNoShow && matchesSearch;
    });

    setFilteredLogs(filtered);
  }, [logs, date, orgFilter, actionFilter, noShowFilter, search]);

  const formatTime = (t) => (t ? dayjs(t).format("h:mm A") : "-");
  const formatDate = (t) => (t ? dayjs(t).format("MM/DD/YYYY") : "-");

  return (
    <div className="min-h-screen bg-gray-900 text-white px-6 py-4">
      <TopBar />
      <h1 className="text-3xl font-bold text-asuGold text-center my-4">Tabling Logs</h1>

      <div className="flex flex-wrap gap-4 justify-center mb-6">
        <input type="date" value={date} onChange={(e) => setDate(e.target.value)} className="bg-gray-800 text-white border border-gray-600 p-2 rounded" />
        <select value={orgFilter} onChange={(e) => setOrgFilter(e.target.value)} className="bg-gray-800 text-white border border-gray-600 p-2 rounded">
          <option value="All">All Organizations</option>
          {organizations.map((org) => (
            <option key={org} value={org}>{org}</option>
          ))}
        </select>
        <select value={actionFilter} onChange={(e) => setActionFilter(e.target.value)} className="bg-gray-800 text-white border border-gray-600 p-2 rounded">
          <option value="All">All Actions</option>
          <option value="check_in">Check In</option>
          <option value="check_out">Check Out</option>
          <option value="no_show">No Show</option>
        </select>
        <select value={noShowFilter} onChange={(e) => setNoShowFilter(e.target.value)} className="bg-gray-800 text-white border border-gray-600 p-2 rounded">
          <option value="All">All</option>
          <option value="Yes">No Show</option>
          <option value="No">Showed</option>
        </select>
        <div className="flex items-center bg-gray-800 border border-gray-600 rounded px-2">
          <FaSearch className="text-white mr-2" />
          <input
            type="text"
            placeholder="Search client, event, spot..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="bg-gray-800 text-white focus:outline-none py-1"
          />
        </div>
      </div>

      <div className="overflow-x-auto">
        <table className="w-full text-sm text-left border-collapse">
          <thead className="bg-slate-800 text-white uppercase text-xs">
            <tr>
              <th className="px-4 py-2">Date</th>
              <th className="px-4 py-2">Time</th>
              <th className="px-4 py-2">User</th>
              <th className="px-4 py-2">Org</th>
              <th className="px-4 py-2">Client</th>
              <th className="px-4 py-2">Event #</th>
              <th className="px-4 py-2">Spot</th>
              <th className="px-4 py-2">Check-In</th>
              <th className="px-4 py-2">Check-Out</th>
              <th className="px-4 py-2">No Show</th>
              <th className="px-4 py-2">Tables</th>
              <th className="px-4 py-2">Chairs</th>
              <th className="px-4 py-2">Notes</th>
            </tr>
          </thead>
          <tbody>
            {filteredLogs.length === 0 && (
              <tr><td colSpan="13" className="text-center py-4">No tabling logs match the selected filters.</td></tr>
            )}
            {filteredLogs.map((log, i) => (
              <tr key={i} className="border-b border-gray-700">
                <td className="px-4 py-2">{formatDate(log.checkInTime || log.checkOutTime || log.rangeStart)}</td>
                <td className="px-4 py-2">{formatTime(log.checkInTime || log.checkOutTime || log.rangeStart)}</td>
                <td className="px-4 py-2">{log.user || "-"}</td>
                <td className="px-4 py-2">{log.organization}</td>
                <td className="px-4 py-2">{log.clientName || "-"}</td>
                <td className="px-4 py-2">{log.eventNumber || "-"}</td>
                <td className="px-4 py-2">{log.tablingSpot || "-"}</td>
                <td className="px-4 py-2">{formatTime(log.checkInTime)}</td>
                <td className="px-4 py-2">{formatTime(log.checkOutTime)}</td>
                <td className="px-4 py-2">
                  {log.noShow ? (
                    <span className="bg-green-600 px-2 py-1 rounded-full text-xs font-semibold">Yes</span>
                  ) : (
                    <span className="bg-red-600 px-2 py-1 rounded-full text-xs font-semibold">No</span>
                  )}
                </td>
                <td className="px-4 py-2">{log.table?.barcode ? `Yes (${log.table.barcode})` : "No"}</td>
                <td className="px-4 py-2">
                  {log.chairs?.length ? `Yes ${log.chairs.length} chair${log.chairs.length > 1 ? "s" : ""} (${log.chairs.map(c => c.barcode).join(", ")})` : "No"}
                </td>
                <td className="px-4 py-2">{log.notes || "-"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default TablingLogs;
